    if (e) {
        Util.log(e);
        Util.log("Affixation shutting down...");
    } else {
        Util.log("OrientDB connection available. Affixing...");

        try {
            Async.forEachSeries(commands, function(query, next) {
                Util.log(query);
                Mynews.odb.query(query)
                    .then(
                        function() {
                            next(null);
                        }
                    );
            }, function(errors) {
                if (errors) {
                    Util.log(errors);
                } else {
                    Util.log('Affixing tasks complete.');
                    process.exit(1);
                }
            });
        }
        catch(e) {
            console.log(e);
        }

    }
